import './App.css';
import { ReactComponent as HeartIcon} from './heart.svg';
import timelineElements from "./timelineElements.js";
import { VerticalTimeline, VerticalTimelineElement } from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";
import {
  BrowserRouter, Routes,
  Route, Link
} from 'react-router-dom';
import RoutePage from './components/RoutePage.js';

function App() {
  let iconStyles = {
    background: "#fff"
  }

  return (
    <BrowserRouter>
    <div>
      <h1 className='title'>Timeline</h1>
      <VerticalTimeline>
        {
          timelineElements.map(memory => {
              return(
                  <VerticalTimelineElement
                    key={memory.key}
                    date={memory.date}
                    dateClassName="date"
                    iconStyle={iconStyles}
                    icon={<HeartIcon className='heart-icon'/>}
                  >
                    <h3 className='vertical-timeline-element-title'>{memory.title}</h3>
                    <h5 className='vertical-timeline-element-subtitle'>{memory.location}</h5>
                    <p id="description">{memory.description}</p>
                    <Routes>
                    <Route>
                      <Link to={'wspomnienia' + memory.id}>{memory.buttonText}</Link>
                    </Route>
                    <Route exact path={'wspomnienia'+ memory.id} element={<RoutePage/>}></Route>
                    </Routes>
                  </VerticalTimelineElement>
              )
          })
        }
      </VerticalTimeline>
    </div>
    </BrowserRouter>
  );
}

export default App;
